import React from 'react'
import Search from './Search'
import Logo from '../images/logo.png'
import AnimalForm from './AnimalForm'
import CatImg from '../images/cat-img.png'
import DogImg from '../images/dog-img.png'
import {Link} from 'react-router-dom'
import styled from 'styled-components'


export default function Header({addNewAnimal, search, setSearch}) {
  return (
    <HeaderDiv >
      <Link to='/'><LogoImg src={Logo} alt="logo"/></Link>
      <Search search={search} setSearch={setSearch}/>

        <nav className='client-side-route'>
            <Link to='/cat-pictures' target='_blank' className='nav-link'><img src={CatImg} className='cat-img-btn'alt="cat-img"/>Pictures</Link>
            <Link to='/dog-pictures' className='nav-link'><img src={DogImg} alt='dog-img' className='dog-img-btn'/>Pictures</Link>
           <AnimalForm addNewAnimal={addNewAnimal}/>
        </nav>  
    </HeaderDiv>
  )
}
const HeaderDiv = styled.div `
  background-color: rgb(230, 117, 64);
  color:white;
  height:80px;
  display:flex;
  align-items: center;
  justify-content: left;
  position: relative;
`
const LogoImg = styled.img`
  width:140px;
`
